import React, { useState } from 'react';
import axios from 'axios';

function BookingList({ bookings, token, fetchBookings, isAdmin }) {
  const [editingId, setEditingId] = useState(null);
  const [editedData, setEditedData] = useState({});

  const handleDelete = async (id) => {
    if (!token) {
      console.error("‚ùå No token provided for delete request.");
      alert("You must be logged in to delete bookings.");
      return;
    }

    console.log("ü™™ Attempting delete with token:", token);

    try {
      await axios.delete(`http://localhost:5000/bookings/${id}`, {
        headers: {
          Authorization: `Bearer ${token}`
        }
      });
      fetchBookings();
    } catch (err) {
      console.error("‚ùå Delete failed:", err.response?.data || err.message);
      alert("‚ùå Failed to delete booking: " + (err.response?.data?.error || err.message));
    }
  };


  const startEdit = (booking) => {
    setEditingId(booking._id);
    setEditedData({
      customer_name: booking.customer_name,
      address: booking.address,
      date_time: booking.date_time.slice(0, 16),
      service_id: booking.service_id?._id || ''
    });
  };

  const saveEdit = async (id) => {
    await axios.put(`http://localhost:5000/bookings/${id}`, editedData, {
      headers: { Authorization: `Bearer ${token}` }
    });
    setEditingId(null);
    fetchBookings();
  };

  return (
    <div className="mt-6 bg-white shadow rounded-xl p-4">
      <h2 className="text-xl font-semibold text-indigo-700 mb-4">Your Bookings</h2>
      {bookings.length === 0 ? (
        <p className="text-gray-500 text-sm">No bookings found.</p>
      ) : (
        <ul className="space-y-3">
          {bookings.map(b => (
            <li key={b._id} className="bg-indigo-50 border border-indigo-200 rounded-md p-3">
              {editingId === b._id ? (
                <div className="space-y-2">
                  <input
                    value={editedData.customer_name}
                    onChange={(e) => setEditedData({ ...editedData, customer_name: e.target.value })}
                    className="w-full px-2 py-1 border rounded"
                  />
                  <input
                    value={editedData.address}
                    onChange={(e) => setEditedData({ ...editedData, address: e.target.value })}
                    className="w-full px-2 py-1 border rounded"
                  />
                  <input
                    type="datetime-local"
                    value={editedData.date_time}
                    onChange={(e) => setEditedData({ ...editedData, date_time: e.target.value })}
                    className="w-full px-2 py-1 border rounded"
                  />
                  <div className="flex gap-2">
                    <button onClick={() => saveEdit(b._id)} className="text-sm text-green-600">Save</button>
                    <button onClick={() => setEditingId(null)} className="text-sm text-gray-600">Cancel</button>
                  </div>
                </div>
              ) : (
                <>
                  <p className="font-medium text-gray-800">
                    {b.customer_name} ‚Äî <span className="text-sm text-gray-600">{b.service_id?.name}</span>
                  </p>
                  <p className="text-sm text-gray-600">üìç {b.address}</p>
                  <p className="text-sm text-gray-600">üïí {new Date(b.date_time).toLocaleString()}</p>
                  <div className="flex gap-3 mt-2">
                    <button onClick={() => startEdit(b)} className="text-sm text-blue-600">Edit</button>
                    <button onClick={() => handleDelete(b._id)} className="text-sm text-red-600">Delete</button>
                  </div>
                </>
              )}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default BookingList;
